import { Router, Routes } from "react-router-dom";
import "./App.css";
import Header from "./components/Header/Header";

function App() {
  return (
    <>
    <Router>
      <Header />
      <Routes to='/' element={Profile} />
    </Router>
    </>
  );
}

export default App;
